export default function Contact() {
    //const phone = props.phone;

    return(
        <div className="contact--card">
            <h1>Interested in working with me?</h1>
            <h2>Let's Connect!</h2>
            <h3>Viviana Alba</h3>
            <h4>vivianaalba7@gmail.com</h4>
            <a href="https://www.linkedin.com/in/vivianaalba/"><img src="linkedin.svg" alt="LinkedIn Logo" /></a>

        </div> 
    )
}
